:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Edward Marsh and DAVIS, Jane
  JWILLIAMS, Thomas Sydney and WILLIAMS, Agnes Lydia
  JWILLIAMS, Harold Edward and WALLIS, Elsie Nora Underwood
  JWILLIAMS, Ann Wallis and GADDUM, Peter Richard (Dick)
  * ::::
  01> WILLIAMS, Ann Wallism on 03.10.1952 to GADDUM, Peter Richard (Dick)
  b 22.03.1926
  b 26.02.1926 d 08.07.1994
  Ann b. at Gisborne and m. at Holy Trinity Church, Gisborne. Dick, s/o Guy
  Morris Gaddum (b. 1900, d. 1955, farmed at "Ponui" station, Mohaka, Wairoa)
  and Sheila Fanny Victoria Jex-Blake (b. 1900, d. 04.01.1985, bd. at Gisborne).
  Dick b. at Gisborne. Address: PO Box 8206, Havelock North.
  Ann was educated at Woodford House. She was a land girl (1944-45) then a
  children's nanny.
  Dick was educated at Huntley School and Wanganui Collegiate School. He served in the Navy (1944-45)
  then went shepherding until 1949 when he took over "Rangimoe", a block of scrub land in the Kereru
  District, Hawkes Bay which he broke in and farmed, then moved to "Arapata" near Havelock North to farm
  in 1970. He broke in more scrub land in Wairoa and bought and farmed further blocks there.
  01> GADDUM, Richard Harold m on 26.02.1977 to EIVERS, Linda Marion
  b 29.10.1953
  b 21.02.1950
  Richard b. at Hastings and m. at Te Puia Springs. Linda, d/o Robert (Bob)
  George Eivers and Alys Annette Barker, b. at Gisborne. (Bob served in the
  Army in Egypt and Italy (1940-45) then managed "Thungia" Station
  (1946-81).) Address: "Rangimoe", RD 1, Hastings.
  Richard was educated at Hereworth and Wanganui Collegiate Schools. He then
  went shepherding on "Ihungia" station, Tokomaru Bay and on cattle stations
  in Central Northern Australia. He and is now farming "Rangimoe" in the Kereru district, Hastings.
  01> GADDUM, James Robert
  b 05.02.1980
  James b. at Hastings. He was educated at Hereworth School and Wanganui
  Collegiate School.
  . .Ae4w YAIKUTNYA
  02> GADDUM, Nicholas Richard
  b 15.09.1982
  Nicholas b. at Hastings,
  03> GADDUM, Georgina Midge
  b 09.11.1983
  Georgina b, at Hastings.
